import React from 'react';
import './App.css';
import SmallText from './components/SmallText.js';
import TitleText from './components/TitleText.js';
import TextButton from './components/TextButton.js';
import DspButton from './components/DspButton.js';
import SwitchButton from './components/SwitchButton.js';
import NumberInput from './components/NumberInput.js';
import TabGroup from './components/ButtonGroup.js';
import {
  Button,
  Container,
  Grid,
  Header,
  Icon,
  Image,
  Item,
  Label,
  Menu,
  Segment,
  Step,
  Table,
} from 'semantic-ui-react';


class SpacingPage extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            streamNumber: null,
            role: null,
            recordDeal: [],
            publishDeal: [],
            sliderValue: null,
            recordDealSelected: null,
            publishingDealSelected: null,
            advance: null
        };

    }

    render() {
      return (
        <Grid celled container stackable>
          <Grid.Row columns={2}>
            <Grid.Column>
              <Segment>Content</Segment>
            </Grid.Column>
            <Grid.Column>
              <Segment>Content</Segment>
            </Grid.Column>
          </Grid.Row>
          <Grid.Row columns={3}>
            <Grid.Column>
              <Segment>Content</Segment>
            </Grid.Column>
            <Grid.Column>
              <Segment>Content</Segment>
            </Grid.Column>
            <Grid.Column>
              <Segment>Content</Segment>
            </Grid.Column>
          </Grid.Row>
          <Grid.Row columns={2}>
            <Grid.Column>
              <Segment>Content</Segment>
            </Grid.Column>
            <Grid.Column>
              <Segment>Content</Segment>
            </Grid.Column>
          </Grid.Row>
        </Grid>
        )
    }
  }

  export default SpacingPage;
